import React from 'react';
import { BsCartCheck } from "react-icons/bs";
import { BiUser } from "react-icons/bi";
import { BiHeart } from "react-icons/bi";
import { BiSearch } from "react-icons/bi";


const navbar = () => {
  return <
    nav className="navbar-head-container">
        <div className="navbar-md-head">

            <div className="navbar-head-logo">
            <h2>FESHION SHOP</h2>
      </div>
      
      <div className='navbar-searchbox-container'>
      <input className='search-input' placeholder='Enter something'  ></input><BiSearch/>
        
      </div>
      <div className='navbar-icons'>
        <BsCartCheck />
        <BiUser/>
        <BiHeart/>
      </div>
      <div className='seprator'></div>
      <div className='navbar-login-signin'>
        <button>login</button>
        <button>Signin</button>
      </div>
      </div>
    </nav>
};
export default navbar;
